import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { MainComponent } from './main/main.component';
import { CategoriasComponent } from './categorias/categorias.component';
import { LoginComponent } from './login/login.component';


const routes: Routes = [
{path:'inicio', component: MainComponent},
{path:'categorias', component:CategoriasComponent},
{path:'tecnologia', component:tecnolog},
{path:'hogar', component:CategoriasComponent},
{path:'deporte', component:CategoriasComponent},
{path:'electrodomesticos', component:CategoriasComponent},
{path:'belleza y cuidado personal', component:CategoriasComponent},
{path:'Login', component:LoginComponent}

];


@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
